description:
Learn Vietnamese with VietnamesePod101! No more dry, out of date textbook story lines! Here at VietnamesePod101, you'll learn Vietnamese with fun, interesting and culturally relevant lessons that are easy to listen to. 

&quot;These podcasts offer a painless and FREE way to bone up on the language and culture in a relevant, real world way that you won't get in a class room or on a CDROM.&quot;
Brian Heater, PC Magazine
